import { FETCH_ALL, CREATE } from '../constants/actionTypes';


const posts = (posts = [], action) => {
    switch (action.type) {
        case 'CREATE':
            return posts;
            return [...posts, action.payload];
        default:
      return posts;     
    }
};


export default posts;
